%[text] # Battery Charging Model
%[text] This live script models the charging behavior of a lithium-ion battery using an RC (resistor-capacitor) circuit approximation. The parameters are based on the Panasonic NCA103450 cell. The script calculates voltage, current, and power over time, and visualizes each with a plot.
%[text] ## Clear Workspace
clear , clc, close all;
%[text] ##  Define Constants 
%[text] These values are estimated to give a realistic time constant for charging. You can modify R and C to simulate different battery conditions.
V_max = 4.2;      % Maximum charging voltage (Volts)
R = 0.25;         % Equivalent resistance (Ohms)
C = 11520;       % Equivalent capacitance (Farads) %[output:3abdf516]
%[text] ## Set up Time Vector 
%[text] Time resolution can be adjusted to smooth curves in the plots 
tau = R * C;            % Time constant (tau) 
t_end = 5 * tau;        % Total simulation time (~99% charge)
t = 0:0.01:t_end;       % Time vector with 0.01-second intervals
%[text] ## Calculate Voltage over Time
%[text] Voltage is computed using the exponential charging equation
V_t = ComputeVoltage(V_max, tau, t);   
%[text] ## Calculate Current over Time
%[text]  Current is calculated as an exponential decay function
I_t = ComputeCurrent(V_max, R, tau, t);    
%[text] ## Calculate Instantaneous Power over Time
%[text]  Power is calculated as the pointwise product of voltage and current
P_t = ComputePower(V_t, I_t) %[output:91389064]
%[text] ## Graph Voltage vs. Time
PlotVoltage(t, V_t); %[output:2ea64ba3]
%[text] ## Graph Current vs. Time
PlotCurrent(t, I_t); %[output:629f69d1]
%[text] ## Graph Power vs. Time
PlotPower(t, P_t); %[output:9899dc0d]

